import "./App.css";
import "@styles/output.css";
import Header from "@components/Header";

function App() {
    return (
        <>
            <Header />
            <div
                className="p-20 h-screen flex justify-center items-start flex-col"
                style={{ backgroundColor: "#FEFFFE" }}
            >
                <p>Testing</p>
            </div>
        </>
    );
}

export default App;
